.imgTile {
   width: 100%;
   height:auto;
}

.addWatchContainer {
    width: 100%;
    height: 100%;
}

.previewBox {
    width: 10rem;
    height: 7rem;
    overflow: hidden;
}

.formBorder {
    border: none;
    border-bottom: 2px solid lightgray;
}

.modal-body {
    padding: .5rem;
}

#add-img-div {
    min-width: 100px;
    min-height: 100px;
}

ul {
    margin: 0;
    padding: 0;
    max-width: 90%;
}

li {
    text-decoration: none;
    list-style-type: none;
    margin: .5em 0 .5em 0;
}

li .form-control, .condition {
    border-radius: 0;
    background-clip: none;
}

.yesValue {
    color: black;
    font-weight: bolder;
    border:none;
    border-bottom: lightgreen .25px solid;
}

.noValue {
    color: black;
    font-weight: lighter;
    border: lightgoldenrodyellow .25px solid;
}

.form-control:focus {
    border-color: inherit;
    -webkit-box-shadow: none;
    box-shadow: none;
}

.dollarSign {
    margin-left: -.25em;
}

.watchImgWrapper {
height: 10.5rem;
}

.watchImg {
    width: auto;
    max-width: 100%;
    height: 100%;
    background-color: white;
}

@media(max-width: 761px) {
    ul {
    max-width: 100%;
    }

    .watchImgWrapper {
    height: 8.5rem;
    }

    .imgTile {
    width: 100%;
    min-height: 6rem;
    }
}

/* ANIMATIONS */

.swap-list-move {
    transition: transform .75s;
}
